;(function () {
  var active
  var magnifier

  var config = {
    scale: 75,
    size: 160,
    image:
      'data:image/png;base64,',
  }

  function pointerSync({ x, y }) {
    document.documentElement.style.setProperty('--x', x)
    document.documentElement.style.setProperty('--y', y)
  }

  function handleKeys({ key }) {
    const displacement = magnifier.querySelector('feDisplacementMap')
    switch (key) {
      case '+':
        displacement.setAttribute(
          'scale',
          parseInt(displacement.getAttribute('scale'), 10) + 5
        )
        break
      case '-':
        displacement.setAttribute(
          'scale',
          parseInt(displacement.getAttribute('scale'), 10) - 5
        )
        break
      case 'Escape':
        teardown()
        break
      default:
        return
    }
  }

  function teardown() {
    magnifier.remove()
    active = false
    window.removeEventListener('keydown', handleKeys)
    window.removeEventListener('pointermove', pointerSync)
  }

  function activateMagnifier({ x, y }) {
    if (active) return
    active = true
    magnifier = Object.assign(document.createElement('div'), {
      className: 'effect',
      innerHTML: `
        <svg viewBox="0 0 100 100" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M12.6758 35.6141C14.5653 30.7128 17.4018 26.2318 21.0231 22.4267C24.6445 18.6216 28.9798 15.5671 33.7816 13.4375" stroke="white" stroke-width="6" stroke-linecap="round"/>
        </svg>
        <svg
          class="filter"
          preserveAspectRatio="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <defs>
            <filter
              id="filter"
              width="100%"
              height="100%"
              x="0"
              y="0"
              color-interpolation-filters="sRGB"
            >
              <feImage
                id="absmap"
                x="0"
                y="0"
                width="100%"
                height="100%"
                result="FE_IMG"
                href="${config.image}"
              ></feImage>
              <feDisplacementMap
                id="displacement"
                in="SourceGraphic"
                in2="FE_IMG"
                xChannelSelector="R"
                yChannelSelector="B"
                scale="${config.scale}"
              ></feDisplacementMap>
            </filter>
          </defs>
        </svg>
        <style>
          .effect {
            height: calc(var(--size) * 1px);
           	width: calc(var(--size) * 1px);
           	border-radius: 50%;
           	background: hsl(210 80% 90% / 0.05);
           	--blue: color-mix(in lch, canvas, hsl(210 10% 40%));
           	border: 2px solid color-mix(in lch, canvasText, var(--blue) 60%);
           	grid-area: 1 / 1;
           	backdrop-filter: url(#filter);
           	position: fixed;
           	top: 0%;
           	left: 0%;
           	translate: -50% -50%;
           	transform: translate(
            		calc(var(--x) * 1px),
            		calc(var(--y) * 1px)
           	) translateY(-15%) scale(var(--scale));
           	pointer-events: none;
           	box-shadow:
              0px 4px 16px rgba(17,17,26,0.1),
              0px 8px 24px rgba(17,17,26,0.1),
              0px 16px 56px rgba(17,17,26,0.1),
              0px 4px 16px rgba(17,17,26,0.1) inset,
              0px 8px 24px rgba(17,17,26,0.1) inset,
              0px 16px 56px rgba(17,17,26,0.1) inset;
            transition: --scale 0.5s;
            z-index: 999999999999;
          }
          .filter {
            width: calc(var(--size) * 1px);
            height: calc(var(--size) * 1px);
          }
        </style>
      `,
    })

    document.body.appendChild(magnifier)
    document.documentElement.style.setProperty('--scale', 1)
    window.addEventListener('pointermove', pointerSync)
    window.addEventListener('keydown', handleKeys)
    pointerSync({ x, y })
  }

  function init() {
    document.documentElement.style.setProperty('--size', config.size)
    document.body.addEventListener('dblclick', activateMagnifier)
    activateMagnifier({ x: 0, y: 0 })
  }

  init()
})()
